import React, { Component } from 'react';
import axios from "axios";
import {Link} from "react-router-dom";


class StageFour extends Component {

    constructor(props){
        super(props);
        this.state={lastArr:[]}
    }

    componentDidMount(){
        var getData = localStorage.getItem('myData');
        var arr=[getData];
        this.setState({lastArr:arr});
    }

    componentDidUpdate(){return true;}

    render() {
        var data = this.state.lastArr.map((item,index)=>{
            return <p key={index}> ${item.name}  ,${item.lname} , ${item.city} </p>
        });
        return (
            <div className="">
                <h1>Your'e Data</h1>
                {data}
            </div>
        );
    }
}

export default StageFour;
